import React from "react";
import styled from "styled-components";

const InforPerfil = ({ content, onClick }) => (
  <Container>
    <BoxOne>
      <section>
        <p>Seguindo</p>
        <p>56</p>
      </section>
      <section>
        <p>Favoritos</p>
        <p>8</p>
      </section>
    </BoxOne>
  </Container>
);

const Container = styled.div`
  background-color: #fff;
`;
const BoxOne = styled.input`
  background-color: #fff;
`;

export default InforPerfil;
